import { createTheme, ThemeProvider } from "@mui/material";

const theme = createTheme({
    components: {
      MuiCssBaseline: {
        styleOverrides: `
          h1 {
            color: grey;
          }
        `,
      },
    },
  });


export default function Home(){
    return(
        <ThemeProvider theme={theme}>
            Hello Home
        </ThemeProvider>
    );
}
